import './App.css';

import'bootstrap/dist/css/bootstrap.css';
import { Container, Row, Col, Navbar, Nav, Form, FormControl, Button} from 'react-bootstrap';
import { LinkContainer } from "react-router-bootstrap";
//import Routes from "./Routes";

function App() {
  return (
    <div className="App">
      
      <div>
        <Navbar bg="dark" variant="dark" className="navbar">
          <Navbar.Brand href="/home">Fisconnect</Navbar.Brand>
          <Nav className="mr-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#freelancers">Freelancers</Nav.Link>
            <Nav.Link href="#about_us">About Us</Nav.Link>
          </Nav>
          <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            <Button variant="outline-light">Search</Button>
          </Form>
        </Navbar>
      </div>

        <Container fluid className="homepageWelcome" style={{ backgroundImage: "url(/images/Homepage2.png)"}} id="background_img">
          <Row>
            <Col>
              <h1>F√çSCONNECT</h1>
            </Col>
          </Row>
          <Row>
            <Col>
            <h3>WE CONNECT BUSINESSES TO FREELANCE VIDEOGRAPHERS & PHOTOGRAPHERS</h3>
            </Col>
          </Row>
        </Container>


    </div>

  );
}

export default App;
